import React from 'react'
import './LoginPage.css'; // Assuming you have a CSS file for styling

function LoginPage() {
  return (

    <div className="loginPage-container">   
      <div className="login-header">
        <h1>Welcome Back!</h1>
        <p>Please login to continue</p>
      </div>
      
    </div>

    
  )
}

export default LoginPage
